    false,nt"url": null,nt"notes": "This report is a summary of a few different
    studies conducted at Wertheim National Wildlife Refuge between 1999-2002. It includes
    the Anuran Breeding Call Surveys from 1999 to 2002 and the Vernal Pool Egg Mass
    studies for 2002 and 2003. The results are listed in table format with dates and
    species occurrences for the Anuran Breeding Call Surveys and the vernal pool egg
    mass tables describe the vernal pool locations, egg mass numbers, spermatophores,
    and comments for each year and refuge.",nt"license_title": "License Not Specified",nt"extras":
